e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0412\u0435\u043d\u0433\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u041a\u0430\u0440\u043b \u0420\u043e\u0431\u0435\u0440\u0442\">\u041a\u0430\u0440\u043b\u0430 I \u0420\u043e\u0431\u0435\u0440\u0442\u0430<\/a>, \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u0432\u0441\u0442\u0440\u0435\u0447\u0430 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0442\u0440\u0435\u0445 \u0434\u0435\u0440\u0436\u0430\u0432&#160;\u2014 \u0412\u0435\u043d\u0433\u0440\u0438\u0438, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B8%D0%BC%D0%B8%D1%80_III\" title=\"\u041a\u0430\u0437\u0438\u043c\u0438\u0440 III\">\u041f\u043e\u043b\u044c\u0448\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BD_%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u042f\u043d \u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439\">\u0427\u0435\u0445\u0438\u0438<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0430\u044f \u043d\u0430\u0447\u0430\u043b\u043e \u0432\u043e\u0435\u043d\u043d\u043e-\u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0441\u043e\u044e\u0437\u0443&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u043c\u0443 \u0432 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0415\u0432\u0440\u043e\u043f\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1717_%D0%B3%D0%BE%D0%B4\" title=\"1717 \u0433\u043e\u0434\">1717<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD_%D0%AD%D1%80%D0%BD%D1%81%D1%82_%D0%AD%D0%BB%D0%B8%D0%B0%D1%81_%D0%91%D0%B5%D1%81%D1%81%D0%BB%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u0418\u043e\u0433\u0430\u043d\u043d \u042d\u0440\u043d\u0441\u0442 \u042d\u043b\u0438\u0430\u0441 \u0411\u0435\u0441\u0441\u043b\u0435\u0440\">\u0418\u043e\u0433\u0430\u043d\u043d \u042d\u0440\u043d\u0441\u0442 \u042d\u043b\u0438\u0430\u0441 \u0411\u0435\u0441\u0441\u043b\u0435\u0440<\/a>, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u0442\u0430\u043a\u0436\u0435 \u043a\u0430\u043a \u041e\u0440\u0444\u0438\u0440\u0435\u0443\u0441 (\u043b\u0430\u0442. Orffyreus), \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u0441\u0432\u043e\u0435\u043c\u0443 \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044e \u043b\u0430\u043d\u0434\u0433\u0440\u0430\u0444\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_%D0%93%D0%B5%D1%81%D1%81%D0%B5%D0%BD-%D0%9A%D0%B0%D1%81%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u041a\u0430\u0440\u043b \u0413\u0435\u0441\u0441\u0435\u043d-\u041a\u0430\u0441\u0441\u0435\u043b\u044c\u0441\u043a\u0438\u0439\">\u041a\u0430\u0440\u043b\u0443 \u0413\u0435\u0441\u0441\u0435\u043d-\u041a\u0430\u0441\u0441\u0435\u043b\u044c\u0441\u043a\u043e\u043c\u0443<\/a> \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0451\u043d\u043d\u044b\u0439 \u0438\u043c \u00ab\u0432\u0435\u0447\u043d\u044b\u0439 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u044c\u00bb, \u0438\u043c\u0435\u0432\u0448\u0438\u0439 \u0432\u0438\u0434 \u043f\u043e\u043b\u043e\u0433\u043e \u043a\u043e\u043b\u0435\u0441\u0430 \u0434\u0438\u0430\u043c\u0435\u0442\u0440\u043e\u043c \u043e\u043a\u043e\u043b\u043e \u0447\u0435\u0442\u044b\u0440\u0451\u0445 \u043c\u0435\u0442\u0440\u043e\u0432 \u0438 \u0442\u043e\u043b\u0449\u0438\u043d\u043e\u0439 \u0442\u0440\u0438\u0434\u0446\u0430\u0442\u044c \u043f\u044f\u0442\u044c \u0441\u0430\u043d\u0442\u0438\u043c\u0435\u0442\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1784_%D0%B3%D0%BE%D0%B4\" title=\"1784 \u0433\u043e\u0434\">1784<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BA%D1%81%D1%84%D0%BE%D1%80%D0%B4\" title=\"\u041e\u043a\u0441\u0444\u043e\u0440\u0434\">\u041e\u043a\u0441\u0444\u043e\u0440\u0434\u0435<\/a> \u043f\u043e\u0434\u043d\u044f\u043b\u0441\u044f \u0432 \u0432\u043e\u0437\u0434\u0443\u0445 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%80%D0%BB%D1%8C%D0%B5%D1%80\" title=\"\u0428\u0430\u0440\u043b\u044c\u0435\u0440\">\u0448\u0430\u043b\u044c\u0435\u0440\u0435<\/a> (\u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%81%D1%82%D0%B0%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0441\u0442\u0430\u0442\">\u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u044b<\/a> \u0441 \u043e\u0431\u043e\u043b\u043e\u0447\u043a\u0430\u043c\u0438, \u043d\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u043c\u0438 \u0432\u043e\u0434\u043e\u0440\u043e\u0434\u043e\u043c) \u0414\u0436\u0435\u0439\u043c\u0441 \u0421\u0430\u0434\u043b\u0435\u0440, \u0441\u0442\u0430\u0432 \u043f\u0435\u0440\u0432\u044b\u043c \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0430\u044d\u0440\u043e\u043d\u0430\u0432\u0442\u043e\u043c <\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1803_%D0%B3%D0%BE%D0%B4\" title=\"1803 \u0433\u043e\u0434\">1803<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87_%D0%9A%D0%B0%D1%80%D0%B0%D0%BC%D0%B7%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447 \u041a\u0430\u0440\u0430\u043c\u0437\u0438\u043d\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447 \u041a\u0430\u0440\u0430\u043c\u0437\u0438\u043d<\/a> \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u00ab\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u043c \u0438\u0441\u0442\u043e\u0440\u0438\u043e\u0433\u0440\u0430\u0444\u043e\u043c\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1808_%D0%B3%D0%BE%D0%B4\" title=\"1808 \u0433\u043e\u0434\">1808<\/a>&#160;\u2014 \u041f\u0443\u0431\u043b\u0438\u0447\u043d\u044b\u0439 \u043f\u043e\u0434\u044a\u0451\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B0\" title=\"\u0412\u0435\u043d\u0430\">\u0412\u0435\u043d\u0435<\/a> \u042f. \u0414\u0435\u0433\u0435\u043d\u0430 \u043d\u0430 \u0441\u0432\u043e\u0451\u043c \u0433\u0438\u0431\u0440\u0438\u0434\u043d\u043e\u043c \u043b\u0435\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u043c \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u0435 (\u043e\u0440\u043d\u0438\u0442\u043e\u043f\u0442\u0435\u0440, \u0447\u0430\u0441\u0442\u0438\u0447\u043d\u043e \u0443\u0440\u0430\u0432\u043d\u043e\u0432\u0435\u0448\u0435\u043d\u043d\u044b\u0439 \u0432\u043e\u0434\u043e\u0440\u043e\u0434\u043d\u044b\u043c \u0431\u0430\u043b\u043b\u043e\u043d\u043e\u043c). <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1847_%D0%B3%D0%BE%D0%B4\" title=\"1847 \u0433\u043e\u0434\">1847<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BB%D0%BE%D1%80%D0%BE%D1%84%D0%BE%D1%80%D0%BC\" title=\"\u0425\u043b\u043e\u0440\u043e\u0444\u043e\u0440\u043c\">\u0445\u043b\u043e\u0440\u043e\u0444\u043e\u0440\u043c\u0430<\/a> \u043a\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B5%D1%81%D1%82%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u0410\u043d\u0435\u0441\u0442\u0435\u0437\u0438\u044f\">\u0430\u043d\u0435\u0441\u0