a.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%BE-%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u043e-\u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u043e-\u0412\u0435\u043d\u0433\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_I_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b I (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0410\u0432\u0441\u0442\u0440\u0438\u0438)\">\u041a\u0430\u0440\u043b I \u0413\u0430\u0431\u0441\u0431\u0443\u0440\u0433<\/a> \u043e\u0442\u0440\u0451\u043a\u0441\u044f \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430. \u041f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0410\u0432\u0441\u0442\u0440\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0420\u0435\u0448\u0435\u043d\u0438\u0435 \u0420\u0435\u0433\u0435\u043d\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0438<\/a> \u043e \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BB%D1%81%D1%83%D0%B4%D1%81%D0%BA%D0%B8%D0%B9,_%D0%AE%D0%B7%D0%B5%D1%84\" title=\"\u041f\u0438\u043b\u0441\u0443\u0434\u0441\u043a\u0438\u