tle=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F_(1921%E2%80%941922)\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f (1921\u20141922)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f<\/a> \u043f\u043e \u0440\u0430\u0437\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u044e (\u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/6_%D1%84%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8F\" title=\"6 \u0444\u0435\u0432\u0440\u0430\u043b\u044f\">6 \u0444\u0435\u0432\u0440\u0430\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u041f\u043e\u0433\u0438\u0431\u0430\u0435\u0442 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430 \u0412\u041c\u0424 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u041c-1 (\u043f\u0435\u0440\u0435\u0434\u0435\u043b\u0430\u043d\u043d\u0430\u044f \u0438\u0437 \u043b\u043e\u0434\u043a\u0438 \u0442\u0438\u043f\u0430 \u041a) \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0-%D0%9C%D0%B0%D0%BD%D1%88\" title=\"\u041b\u0430-\u041c\u0430\u043d\u0448\">\u041b\u0430-\u041c\u0430\u043d\u0448\u0435<\/a> \u0441\u043e \u0448\u0432\u0435\u0434\u0441\u043a\u0438\u043c \u043f\u0430\u0440\u043e\u0445\u043e\u0434\u043e\u043c \u00ab\u0412\u0438\u0434\u0435\u0440\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D1%86%D0%BA%D0%B8%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0440\u043e\u0446\u043a\u0438\u0439, \u041b\u0435\u0432 \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0438\u0447\">\u0422\u0440\u043e\u0446\u043a\u0438\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BD%D0%BE%D0%B2%D1%8C%D0%B5%D0%B2,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%95%D0%B2%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0417\u0438\u043d\u043e\u0432\u044c\u0435\u0432, \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0415\u0432\u0441\u0435\u0435\u0432\u0438\u0447\">\u0417\u0438\u043d\u043e\u0432\u044c\u0435\u0432<\/a> \u0438\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u044b \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%9A%D0%9F(%D0%B1)\" class=\"mw-redirect\" title=\"\u0412\u041a\u041f(\u0431)\">\u0412\u041a\u041f(\u0431)<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u00ab\u041a\u0440\u0443\u0433\u043b\u044b\u0439 \u0441\u0442\u043e\u043b\u00bb \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u0438<\/a> (\u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/19_%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8F\" title=\"19 \u044f\u043d\u0432\u0430\u0440\u044f\">19 \u044f\u043d\u0432\u0430\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931_%D0%B3%D0%BE%D0%B4\" title=\"1931 \u0433\u043e\u0434\">1931<\/a>). \u041f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0438 \u041f\u0430\u0440\u0442\u0438\u0438 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u044e\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u041d\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> 92&#160;% \u0433\u043e\u043b\u043e\u0441\u043e\u0432 \u043e\u0442\u0434\u0430\u043d\u043e \u0437\u0430 \u0441\u043f\u0438\u0441\u043e\u043a \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u043e\u0432 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB-%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B5%D0%BC%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b-\u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0430\u044f \u0440\u0430\u0431\u043e\u0447\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f\">\u043d\u0430\u0446\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438<\/a> (96&#160;% \u043c\u0435\u0441\u0442 \u0432 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u043c\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%85-%D0%9D%D0%B5%D1%81%D1%81%D0%BA%D0%BE%D0%B5_%D1%87%D1%83%D0%B4%D0%BE%D0%B2%D0%B8%D1%89%D0%B5\" class=\"mw-redirect\" title=\"\u041b\u043e\u0445-\u041d\u0435\u0441\u0441\u043a\u043e\u0435 \u0447\u0443\u0434\u043e\u0432\u0438\u0449\u0435\">\u043b\u043e\u0445-\u043d\u0435\u0441\u0441\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0432\u0438\u0449\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 \u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b \u0421\u0421\u0421\u0420 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B2,_%D0%92%D1%8F%D1%87%D0%B5%D1%81%D0%BB%D0%B0%D0%B2_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u043e\u043b\u043e\u0442\u043e\u0432, \u0412\u044f\u0447\u0435\u0441\u043b\u0430\u0432 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u041c\u043e\u043b\u043e\u0442\u043e\u0432<\/a> \u043f\u0440\u0438\u0431\u044b\u0432\u0430\u0435\u0442 \u0441 \u0432\u0438\u0437\u0438\u0442\u043e\u043c \u0432 \u0411\u0435\u0440\u043b\u0438\u043d \u0434\u043b\u044f \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u043e\u0432 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0413\u0438\u0442\u043b\u0435\u0440\u043e\u043c<\/a> \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B1%D0%B1%D0%B5%D0%BD%D1%82%D1%80%D0%BE%D0%BF,_%D0%98%D0%BE%D0%B0%D1%85%D0%B8%D0%BC_%D1%84%D0%BE%D0%BD\" title=\"\u0420\u0438\u0431\u0431\u0435\u043d\u0442\u0440\u043e\u043f, \u0418\u043e\u0430\u0445\u0438\u043c \u0444\u043e\u043d\">\u0420\u0438\u0431\u0431\u0435\u043d\u0442\u0440\u043e\u043f\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u041e\u0412<\/a>: \u041d\u0430\u0447\u0430\u043b\u043e \u00ab\u0441\u0442\u0440\u0430\u0448\u043d\u044b\u0445 \u043c\u043e\u0440\u043e\u0437\u043e\u0432\u00bb (\u221212 \u00b0\u0421) \u0432 \u041f\u043e\u0434\u043c\u043e\u0441\u043a\u043e\u0432\u044c\u0435, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0444\u043e\u043d \u0411\u043e\u043a\u043e\u043c \u0441\u043f\u0438\u0441\u0430\u043d\u043e \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0433\u0440\u0443\u043f\u043f\u044b \u0430\u0440\u043c\u0438\u0439 \u00ab\u0426\u0435\u043d\u0442\u0440\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0438\u0441\u044c \u0448\u0435\u0441\u0442\u0438\u0434\u043d\u0435\u0432\u043d\u044b\u0435 \u0431\u043e\u0438 \u0443 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BA%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7\" title=\"\u0412\u043b\u0430\u0434\u0438\u043a\u0430\u0432\u043a\u0430\u0437\">\u041e\u0440\u0434\u0436\u043e\u043d\u0438\u043a\u0438\u0434\u0437\u0435<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b\u0430 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0443\u0434\u0430\u0440\u043d\u0430\u044f \u0433\u0440\u0443\u043f\u043f\u0438\u0440\u043e\u0432\u043a\u0430 1-\u0439 \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u0442\u0430\u043d\u043a\u043e\u0432\u043e\u0439 \u0430\u0440\u043c\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u041a\u043e\u043d\u0432\u043e\u0439 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0432\u0438\u0446\u0435-\u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0430 \u0425\u0438\u0440\u043e\u0430\u043a\u0435 \u0410\u0431\u0435 \u0432\u0445\u043e\u0434\u0438\u0442 \u0432 \u043f\u0440\u043e\u043b\u0438\u0432 \u043c\u0435\u0436\u0434\u0443 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%B0%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432 \u0421\u0430\u0432\u043e\">\u0421\u0430\u0432\u043e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B2%D0%B0%D0%B4%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" class=\"mw-redirect\" title=\"\u0413\u0432\u0430\u0434\u0430\u043b\u043a\u0430\u043d\u0430\u043b\">\u0413\u0432\u0430\u0434\u0430\u043b\u043a\u0430\u043d\u0430\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u041c\u0412<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%92%D0%A1_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u0412\u0412\u0421 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u0412\u0412\u0421 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043f\u043e\u0442\u043e\u043f\u0438\u043b\u0438 \u0444\u043b\u0430\u0433\u043c\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D0%B3%D1%81%D0%BC%D0%B0%D1%80%D0%B8%D0%BD%D0%B5\" title=\"\u041a\u0440\u0438\u0433\u0441\u043c\u0430\u0440\u0438\u043d\u0435\">\u043a\u0440\u0438\u0433\u0441\u043c\u0430\u0440\u0438\u043d\u0435<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D0%BA%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u041b\u0438\u043d\u043a\u043e\u0440\">\u043b\u0438\u043d\u043a\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D0%B5%D0%B9%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D1%8C_%C2%AB%D0%A2%D0%B8%D1%80%D0%BF%D0%B8%D1%86%C2%BB\" class=\"mw-redirect\" title=\"\u041b\u0438\u043d\u0435\u0439\u043d\u044b\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u00ab\u0422\u0438\u0440\u043f\u0438\u0446\u00bb\">\u00ab\u0422\u0438\u0440\u043f\u0438\u0446\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 \u041d\u0430 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a> \u043f\u043e\u0431\u0435\u0436\u0434\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%B7_%D0%A2%D0%B8%D1%82%D0%BE,_%D0%98%D0%BE%D1%81%D0%B8%D0%BF\" title=\"\u0411\u0440\u043e\u0437 \u0422\u0438\u0442\u043e, \u0418\u043e\u0441\u0438\u043f\">\u0418\u043e\u0441\u0438\u043f \u0411\u0440\u043e\u0437 \u0422\u0438\u0442\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0-8\" title=\"\u041a\u0430-8\">\u041a\u0430-8<\/a> \u0434\u0432\u0443\u0445\u0432\u0438\u043d\u0442\u043e\u0432\u043e\u0439 \u0441\u043e\u043e\u0441\u043d\u043e\u0439 \u0441\u0445\u0435\u043c\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE\" title=\"\u0422\u043e\u043a\u0438\u043e\">\u0422\u043e\u043a\u0438\u043e<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044f<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%86%D0%B5%D1%81%D1%81\" title=\"\u0422\u043e\u043a\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\">\u0441\u0443\u0434\u0435\u0431\u043d\u044b\u