u0437\u0438\u0438<\/a> (\u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%B1%D0%B0%D0%B1%D0%B2%D0%B5\" title=\"\u0417\u0438\u043c\u0431\u0430\u0431\u0432\u0435\">\u0417\u0438\u043c\u0431\u0430\u0431\u0432\u0435<\/a>) \u0432\u044b\u043d\u043e\u0441\u0438\u0442 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0437\u0430\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BA%D0%BE%D0%BC%D0%BE,_%D0%94%D0%B6%D0%BE%D1%88%D1%83%D0%B0\" title=\"\u041d\u043a\u043e\u043c\u043e, \u0414\u0436\u043e\u0448\u0443\u0430\">\u0414\u0436\u043e\u0448\u0443\u0430 \u041d\u043a\u043e\u043c\u043e<\/a> \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0435\u0437\u0430\u043a\u043e\u043d\u043d\u044b\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0435\u0442\u0441\u044f \u0432 \u0441\u0442\u043e\u0440\u043e\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430 (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0412\u0435\u043d\u0435\u0440\u044b<\/a> \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0-2\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430-2\">\u0412\u0435\u043d\u0435\u0440\u0430-2<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043b\u0430\u0439\u043d\u0435\u0440 \u00abYarmouth Castle\u00bb, \u0438\u043c\u0435\u044f \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 600 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u0438 \u044d\u043a\u0438\u043f\u0430\u0436, \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u044f \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B9%D0%B0%D0%BC%D0%B8\" title=\"\u041c\u0430\u0439\u0430\u043c\u0438\">\u041c\u0430\u0439\u0430\u043c\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%81%D1%81%D0%B0%D1%83_(%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u041d\u0430\u0441\u0441\u0430\u0443 (\u0433\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u043e)\">\u041d\u0430\u0441\u0441\u0430\u0443<\/a> \u0437\u0430\u0433\u043e\u0440\u0430\u0435\u0442\u0441\u044f \u043f\u043e \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0439 \u043f\u0440\u0438\u0447\u0438\u043d\u0435. \u041f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0432\u044b\u0433\u043e\u0440\u0435\u0432, \u043b\u0430\u0439\u043d\u0435\u0440 \u0437\u0430\u0442\u043e\u043d\u0435\u0442 \u043d\u0430 \u0442\u0440\u0435\u0442\u044c\u0438 \u0441\u0443\u0442\u043a\u0438. \u041f\u043e\u0433\u0438\u0431\u043d\u0435\u0442 92 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u0431\u043e\u043b\u0435\u0435 400 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u043b\u0443\u0447\u0430\u0442 \u0441\u0435\u0440\u044c\u0451\u0437\u043d\u044b\u0435 \u043e\u0436\u043e\u0433\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044f<\/a> \u0441 \u044d\u0442\u043e\u0433\u043e \u0434\u043d\u044f \u043e\u0442\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u0438\u0437\u043d\u0430\u0432\u0430\u0442\u044c \u0433\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u0441\u043a\u0438\u0435 \u043f\u0430\u0441\u043f\u043e\u0440\u0442\u0430, (\u0437\u0430\u043a\u0440\u044b\u043b\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%B1%D1%80%D0%B0%D0%BB%D1%82%D0%B0%D1%80\" title=\"\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\">\u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u043e\u043c<\/a> \u0434\u043b\u044f \u0432\u0441\u0435\u0445 \u0432\u0438\u0434\u043e\u0432 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/5_%D0%BE%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"5 \u043e\u043a\u0442\u044f\u0431\u0440\u044f\">5 \u043e\u043a\u0442\u044f\u0431\u0440\u044f<\/a> \u043d\u0430 17 \u043b\u0435\u0442).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e\u0434\">1970<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u044e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u041f\u0430\u043a\u0438\u0441\u0442\u0430\u043d\">\u043f\u0430\u043a\u0438\u0441\u0442\u0430\u043d\u0441\u043a\u0443\u044e<\/a> \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u044e \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u0411\u0435\u043d\u0433\u0430\u043b\u0438\u044f (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D0%B3%D0%BB%D0%B0%D0%B4%D0%B5%D1%88\" title=\"\u0411\u0430\u043d\u0433\u043b\u0430\u0434\u0435\u0448\">\u0411\u0430\u043d\u0433\u043b\u0430\u0434\u0435\u0448<\/a>) \u043e\u0431\u0440\u0443\u0448\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0446\u0438\u043a\u043b\u043e\u043d \u0438 \u043c\u043e\u0449\u043d\u0430\u044f \u043f\u0440\u0438\u043b\u0438\u0432\u043d\u0430\u044f \u0432\u043e\u043b\u043d\u0430, \u043f\u0440\u0438\u0432\u0435\u0434\u0448\u0438\u0435 \u043a \u0433\u0438\u0431\u0435\u043b\u0438 \u0441\u0432\u044b\u0448\u0435 500 \u0442\u044b\u0441. \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971_%D0%B3%D0%BE%D0%B4\" title=\"1971 \u0433\u043e\u0434\">1971<\/a>&#160;\u2014 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D1%81%D0%BE%D0%BD,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_%D0%9C%D0%B8%D0%BB%D1%85%D0%B0%D1%83%D0%B7\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u0441\u043e\u043d, \u0420\u0438\u0447\u0430\u0440\u0434 \u041c\u0438\u043b\u0445\u0430\u0443\u0437\">\u041d\u0438\u043a\u0441\u043e\u043d<\/a> \u0437\u0430\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0445 \u0431\u043e\u0435\u0432\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u042e\u0436\u043d\u044b\u0439 \u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u042e\u0436\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a> \u0438 \u043e\u0442\u0434\u0430\u0451\u0442 \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u0435 \u043e \u0432\u044b\u0432\u043e\u0434\u0435 \u0435\u0449\u0451 45 \u0442\u044b\u0441\u044f\u0447 \u0432\u043e\u0435\u043d\u043d\u043e\u0441\u043b\u0443\u0436\u0430\u0449\u0438\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971_%D0%B3%D0%BE%D0%B4\" title=\"1971 \u0433\u043e\u0434\">1971<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%BD%D0%B8%D1%86%D0%B0\" title=\"\u0412\u0438\u043d\u043d\u0438\u0446\u0430\">\u0412\u0438\u043d\u043d\u0438\u0446\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>. \u041f\u0440\u0438 \u043f\u043e\u043f\u044b\u0442\u043a\u0435 \u0443\u0439\u0442\u0438 \u043d\u0430 \u043d\u043e\u0432\u044b\u0439 \u043a\u0440\u0443\u0433 \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%84%D0%BB%D0%BE%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0444\u043b\u043e\u0442\">\u0410\u044d\u0440\u043e\u0444\u043b\u043e\u0442\u0430<\/a>\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-24\" title=\"\u0410\u043d-24\">\u0410\u043d-24<\/a>. \u0412\u0441\u0435 47 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a>&#160;\u2014 \u0412 \u0437\u043d\u0430\u043a \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0439 \u043e\u043f\u043b\u0430\u0442\u044b \u0442\u0440\u0443\u0434\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u0448\u0430\u0445\u0442\u0451\u0440\u044b \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u044e\u0442 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e\u0431 \u043e\u0442\u043a\u0430\u0437\u0435 \u043e\u0442 \u0441\u0432\u0435\u0440\u0445\u0443\u0440\u043e\u0447\u043d\u044b\u0445 \u0440\u0430\u0431\u043e\u0442.<\/li><li>1973&#160;\u2014 \u0414\u0435\u043d\u044c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0445\u0438\u043f-\u0445\u043e\u043f \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1840_%D0%B3%D0%BE%D0%B4\" title=\"1840 \u0433\u043e\u0434\">1840 \u0433\u043e\u0434\u0430<\/a> \u043b\u043e\u0441\u043e\u0441\u044c \u043f\u043e\u0439\u043c\u0430\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BC%D0%B7%D0%B0\" title=\"\u0422\u0435\u043c\u0437\u0430\">\u0422\u0435\u043c\u0437\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 \u0412 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043e\u0442\u0432\u0435\u0442\u043d\u043e\u0439 \u043c\u0435\u0440\u044b \u043d\u0430 \u0437\u0430\u0445\u0432\u0430\u0442 \u0437\u0434\u0430\u043d\u0438\u044f \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u043e\u043b\u044c\u0441\u0442\u0432\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B3%D0%B5%D1%80%D0%B0%D0%BD\" title=\"\u0422\u0435\u0433\u0435\u0440\u0430\u043d\">\u0422\u0435\u0433\u0435\u0440\u0430\u043d\u0435<\/a> \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%82%D0%B5%D1%80,_%D0%94%D0%B6%D0%B8%D0%BC%D0%BC%D0%B8\" title=\"\u041a\u0430\u0440\u0442\u0435\u0440, \u0414\u0436\u0438\u043c\u043c\u0438\">\u041a\u0430\u0440\u0442\u0435\u0440<\/a> \u0432\u0432\u043e\u0434\u0438\u0442 \u044d\u043c\u0431\u0430\u0440\u0433\u043e \u043d\u0430 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0438\u0440\u0430\u043d\u0441\u043a\u043e\u0439 \u043d\u0435\u0444\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0434\">1980<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%8F%D0%B4%D0%B6%D0%B5%D1%80-1\" title=\"\u0412\u043e\u044f\u0434\u0436\u0435\u0440-1\">\u0412\u043e\u044f\u0434\u0436\u0435\u0440-1<\/a>\u00bb, \u043e\u0442\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f 5 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f 1977, \u043f\u0435\u0440\u0435\u0441\u0435\u043a\u0430\u0435\u0442 \u043e\u0440\u0431\u0438\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u0421\u0430\u0442\u0443\u0440\u043d (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0421\u0430\u0442\u0443\u0440\u043d\u0430<\/a>, \u043f\u0440\u043e\u0445\u043e\u0434\u044f \u043e\u0442 \u043d\u0435\u0433\u043e \u043d\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0438 124 000&#160;\u043a\u043c \u0438 \u0432 4500&#160;\u043a\u043c \u043e\u0442 \u0435\u0433\u043e \u0441\u043f\u0443\u0442\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%82%D0%B0%D0%BD_(%D1%81%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA)\" title=\"\u0422\u0438\u0442\u0430\u043d (\u0441\u043f\u0443\u0442\u043d\u0438\u043a)\">\u0422\u0438\u0442\u0430\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0442\u0440\u0430\u043d\u0441\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u043b\u0451\u0442 \u043d\u0430 \u0433\u0430\u0437\u043e\u043d\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u043e\u043c \u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u0435 \u00ab\u0414\u0430\u0431\u043b \u0418\u0433\u043b V\u00bb. \u041c\u0430\u0440\u0448\u0440\u0443\u0442 \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u0435\u0439 \u043f\u0440\u043e\u043b\u0451\u0433 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B3%D0%B0%D1%81%D0%B8%D0%BC%D0%B0,_%D0%AE\" title=\"\u041d\u0430\u0433\u0430\u0441\u0438\u043c\u0430, \u042e\">\u041d\u0430\u0433\u0430\u0441\u0438\u043c\u043e\u0439<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044f<\/a>) \u0438 \u041a\u043e\u0432\u0435\u043b\u043b\u043e (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f\">\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>). \u041e\u043d \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0440\u0435\u043a\u043e\u0440\u0434 \u0434\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u043f\u043e\u043b\u0451\u0442\u0430 \u0434\u043b\u044f \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u043e\u0433\u043e \u0433\u0430\u0437\u043e\u043d\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u043e\u0433\u043e \u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u0430&#160;\u2014 8382,54 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 \u0417\u0430\u043f\u0443\u0441\u043a \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u0430\u0431\u043b\u044f \u043c\u043d\u043e\u0433\u043e\u0440\u0430\u0437\u043e\u0432\u043e\u0433\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u00ab\u0421\u043f\u0435\u0439\u0441 \u0428\u0430\u0442\u0442\u043b-2 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f-2\u00bb, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BD%D0%B3%D0%BB,_%D0%94%D0%B6%D0%BE\" class=\"mw-redirect\" title=\"\u042d\u043d\u0433\u043b, \u0414\u0436\u043e\">\u0414\u0436\u043e \u042d\u043d\u0433\u043b<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A2%D1%80%D1%83%D0%BB%D0%B8,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0422\u0440\u0443\u043b\u0438, \u0420\u0438\u0447\u0430\u0440\u0434 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0420\u0438\u0447\u0430\u0440\u0434 \u0422\u0440\u0443\u043b\u0438<\/a> (\u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/14_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"14 \u043d\u043e\u044f\u0431\u0440\u044f\">14 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 \u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0438\u043d\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C\" class=\"mw-redirect\" title=\"\u0410\u043d\u0433\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c\">\u0430\u043d\u0433\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439<\/a> \u0446\u0435\u0440\u043a\u0432\u0438 \u043f\u043e\u0434\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u043c \u0447\u0438\u0441\u043b\u043e\u043c \u0433\u043e\u043b\u043e\u0441\u043e\u0432 \u0432\u044b\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0437\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0435 \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u044b\u0445 \u0446\u0435\u0440\u043a\u0432\u0435\u0439, \u043f\u0440\u043e\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a\u043e\u0432-\u0436\u0435\u043d\u0449\u0438\u043d \u0438 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043f\u043e\u0441\u0432\u044f\u0449\u0430\u0442\u044c \u0436\u0435\u043d\u0449\u0438\u043d \u0432 \u0434\u0443\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0430\u043d \u0430\u043d\u0433\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 \u041d\u0430 \u041f\u043b\u0435\u043d\u0443\u043c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%9A_%D0%9A%D0%9F%D0%A1%D0%A1\" class=\"mw-redirect\" title=\"\u0426\u041a \u041a\u041f\u0421\u0421\">\u0426\u041a \u041a\u041f\u0421\u0421<\/a> \u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u043c \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u0451\u043c \u0426\u041a \u041a\u041f\u0421\u0421 \u043f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D0%B6%D0%BD%D0%B5%D0%B2,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0411\u0440\u0435\u0436\u043d\u0435\u0432, \u041b\u0435\u043e\u043d\u0438\u0434 \u0418\u043b\u044c\u0438\u0447\">\u041b.&#160;\u0418.&#160;\u0411\u0440\u0435\u0436\u043d\u0435\u0432\u0430<\/a> \u0438\u0437\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B4%D1%80%D0%BE%D0%BF%D0%BE%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043d\u0434\u0440\u043e\u043f\u043e\u0432, \u042e\u0440\u0438\u0439 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u042e\u0440\u0438\u0439 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447 \u0410\u043d\u0434\u0440\u043e\u043f\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%B4%D0%B8%D1%81-%D0%90%D0%B1%D0%B5%D0%B1%D0%B0\" title=\"\u0410\u0434\u0434\u0438\u0441-\u0410\u0431\u0435\u0431\u0430\">\u0410\u0434\u0434\u0438\u0441-\u0410\u0431\u0435\u0431\u0435<\/a> \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0430 \u043d\u0430 \u0443\u0440\u043e\u0432\u043d\u04