i><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 \u0411\u0435\u0441\u043f\u043e\u0440\u044f\u0434\u043a\u0438 \u0438 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D1%8B%D0%B9_%D0%A2%D0%B8%D0%BC%D0%BE%D1%80\" title=\"\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439 \u0422\u0438\u043c\u043e\u0440\">\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u043c \u0422\u0438\u043c\u043e\u0440\u0435<\/a> \u043f\u0440\u0438\u0432\u043b\u0435\u043a\u0430\u044e\u0442 \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u043a \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0435 \u0443\u0433\u043d\u0435\u0442\u0435\u043d\u0438\u044f, \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u043e\u0439 \u0438\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u0439\u0441\u043a\u0438\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u044f\u043c\u0438 \u0432 \u044d\u0442\u043e\u043c \u0440\u0435\u0433\u0438\u043e\u043d\u0435 (\u0441\u043e\u0431\u044b\u0442\u0438\u044f \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442\u0441\u044f \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/13_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"13 \u043d\u043e\u044f\u0431\u0440\u044f\">13 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u0412 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0430\u043c\u0438 \u043f\u0440\u043e\u0432\u0435\u0434\u0451\u043d\u043d\u043e\u0433\u043e \u043d\u0435\u0434\u0430\u0432\u043d\u043e \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f, \u043e\u0442\u043d\u044b\u043d\u0435 \u0432 \u0410\u043d\u0433\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438 \u0432 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0430\u043d \u043c\u043e\u0433\u0443\u0442 \u0440\u0443\u043a\u043e\u043f\u043e\u043b\u0430\u0433\u0430\u0442\u044c\u0441\u044f \u0442\u0430\u043a\u0436\u0435 \u0438 \u0436\u0435\u043d\u0449\u0438\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0425\u043e\u0440\u0432\u0430\u0442\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0438 \u0441\u0435\u0440\u0431\u0441\u043a\u0438\u0435 \u043b\u0438\u0434\u0435\u0440\u044b \u043f\u0440\u0438\u0445\u043e\u0434\u044f\u0442 \u043a \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044e \u043e \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0435 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0421\u043b\u0430\u0432\u043e\u043d\u0438\u0438, \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0439 \u0445\u043e\u0440\u0432\u0430\u0442\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438, \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u0443\u0435\u043c\u043e\u0439 \u0441\u0435\u0440\u0431\u0430\u043c\u0438, \u043f\u043e\u0434 \u044e\u0440\u0438\u0441\u0434\u0438\u043a\u0446\u0438\u044e \u0425\u043e\u0440\u0432\u0430\u0442\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 \u0421\u0432\u0430\u0434\u044c\u0431\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0442\u0435\u043b\u0435\u0430\u043a\u0442\u0440\u0438\u0441\u044b \u041a\u044d\u043d\u0434\u0435\u0439\u0441 \u0425\u0435\u043b\u0435\u043d \u041a\u0430\u043c\u0435\u0440\u043e\u043d \u0438 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0445\u043e\u043a\u043a\u0435\u0438\u0441\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D0%B5,_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0443\u0440\u0435, \u0412\u0430\u043b\u0435\u0440\u0438\u0439 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u0430\u043b\u0435\u0440\u0438\u044f \u0411\u0443\u0440\u0435<\/a>, \u043c\u043b\u0430\u0434\u0448\u0435\u0433\u043e \u0431\u0440\u0430\u0442\u0430 \u0437\u0432\u0435\u0437\u0434\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D1%85%D0%BE%D0%BA%D0%BA%D0%B5%D0%B9%D0%BD%D0%B0%D1%8F_%D0%BB%D0%B8%D0%B3%D0%B0\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u0445\u043e\u043a\u043a\u0435\u0439\u043d\u0430\u044f \u043b\u0438\u0433\u0430\">\u041d\u0425\u041b<\/a> \u041f\u0430\u0432\u043b\u0430 \u0411\u0443\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A7%D0%B0%D1%80%D1%85%D0%B8-%D0%94%D0%B0%D1%80%D0%B8&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0427\u0430\u0440\u0445\u0438-\u0414\u0430\u0440\u0438 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0427\u0430\u0440\u0445\u0438-\u0414\u0430\u0440\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u044f<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0%D0%B4_%D0%A7%D0%B0%D1%80%D1%85%D0%B8_%D0%94%D0%B0%D0%B4%D1%80%D0%B8\" title=\"\u0421\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u043d\u0430\u0434 \u0427\u0430\u0440\u0445\u0438 \u0414\u0430\u0434\u0440\u0438\">\u0421\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u0432 \u0432\u043e\u0437\u0434\u0443\u0445\u0435<\/a> \u0430\u0432\u0438\u0430\u043b\u0430\u0439\u043d\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Boeing_747\" title=\"Boeing 747\">\u0411\u043e\u0438\u043d\u0433-747<\/a> \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab\u0421\u0430\u0443\u0434\u0438 \u0410\u0440\u0430\u0431\u0438\u0430\u043d \u042d\u0439\u0440\u043b\u0430\u0439\u043d\u0441\u00bb \u0438 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB-76\" title=\"\u0418\u043b-76\">\u0418\u043b-76<\/a>\u0422\u0414, \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0449\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\">\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\u0443<\/a>. 349 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a>&#160;\u2014 \u0418\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0432\u0443\u043b\u043a\u0430\u043d\u0430 \u0422\u0443\u043d\u0433\u0443\u0440\u0430\u0445\u0443\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u042d\u043a\u0432\u0430\u0434\u043e\u0440\">\u042d\u043a\u0432\u0430\u0434\u043e\u0440<\/a>).<\/li><\/ul><h2>"}